import React from 'react';
import './App.css';

function App() {
  return (
    <div className="outer">
      <div className="center"/>
      <div className="left-bottom"></div>
      <div className="row">
          <div className="box float-box"/>
          <div className="box float-box"/>
          <div className="box float-box"/>
      </div>
      <div className="new-row box"/>
      <div className="absolute-center box"/>
    </div>
  );
}

export default App;
